import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import Logo from '../logo.svg';
import styled from 'styled-components';
import {ButtonContainer} from './button';

export default class Navbar extends Component {
    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <Link to='/'>
                    {/* <p className="navbar-brand">Riddle Store</p> */}
                    <img src={Logo} alt="Logo" width="30px" className="navbar-brand"/>
                </Link>
                <ul className="navbar-nav align-items-center">
                    <li className="nav-item ml-5"><Link to='/'>Products</Link></li>
                </ul>
                <Link to='/cart' className="ml-auto">
                    <ButtonContainer><i className="fa fa-cart-plus mr-2"></i>My Cart</ButtonContainer>
                </Link>
            </nav>
        )
    }
}
